DROP TABLE IF EXISTS `logs`;
CREATE TABLE `logs`  (
  `log_id` int(20) NOT NULL AUTO_INCREMENT COMMENT '日志编号',
  `dev_id` int(20) NULL DEFAULT NULL COMMENT '设备编号',
  `dev_status` int(1) NULL DEFAULT NULL COMMENT '设备出借状态(1:空闲,2:出借)',
  `dev_work_status` int(1) NULL DEFAULT NULL COMMENT '设备状态(1:正常,2:报废,3:故障,4:维修,5:待报废)',
