  `token_status` int(1) NULL DEFAULT NULL COMMENT '指令执行状态(1:执行成功,2:执行失败,3:待办,4:已撤回)',
  `sender_account` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '执行操作用户账号',
  `receiver_account` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '接收人账号',
  `change_time` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更改日期(自动获取)',
  `auth` int(20) NULL DEFAULT NULL,
  PRIMARY KEY (`log_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1233 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '设备日志记录表' ROW_FORMAT = Dynamic;

